import React from "react";

import "./App.css";

function App() {
  function getName(name) {
    return name.firstName + " " + name.lastName.toLowerCase();
  }

  const myname = {
    firstName: "Bob",
    lastName: "Dylan",
  };

  return (
    <div className="App">
      <h1>This is {getName(myname)}!</h1>;
    </div>
  );
}

export default App;
